import React from 'react'

const Ingredients = ({ingredients}) => {
    return (
        <div>
            {ingredients.map((el) => {
                return (
                    <>
                        <div className="card-header d-flex justify-content-between">
                            <span>{el.name}</span>
                            <span></span>

                        </div>
                        <div className="card-body">
                            <p className="card-text">
                                {el.review}
                            </p>
                        </div>
                    </>
                )
            })}
        </div>
    )
}

export default Ingredients

